import React from "react";
import { Input } from "@chakra-ui/core";
export const Exercise = () => {
    return (
        <div>
            Try this first Exercise: <br />
            <Input size="lg" placeholder="a" w="3rem" />
            <Input size="lg" placeholder="b" w="3rem" />
            <Input size="lg" placeholder="c" w="3rem" />
            <Input size="lg" placeholder="d" w="3rem" />
            <Input size="lg" placeholder="e" w="3rem" />
        </div>
    )
}
